import React, { Component } from "react";
import BlogPostPreview from "./BlogPostPreview";
import BlogPostPreviewList from "./BlogPostPreviewList";

class Home extends Component {
  constructor(props) {
    super(props);

    this.state = {
      previewPosts: [
        {
          title: "Test Post One",
          date: "01/09/2021",
          time: "5:52 PM",
          text:
            "blah blah blah blah this is a lot of text but i dont really know what to talk about I guess it doesn't really matter to anyone except myself who is currently typing out this long string of text hopefully it is long enough and doesn't contain too many spelling mistakes.",
        },
        {
          title: "Test Post Two",
          date: "01/09/2021",
          time: "5:52 PM",
          text:
            "Lorem ipsum bipsum mipsum quipsum greetsum meepe meepu beebebe bebebeb ooka agaug the quick fox jumped over the lazy brown dog",
        },
      ],
    };
  }

  render() {
    return (
      <React.Fragment>
        <BlogPostPreviewList posts={this.state.previewPosts} />
      </React.Fragment>
    );
  }
}

export default Home;
